//https://www.youtube.com/watch?v=4eVTKxNr30M&t=28s
const getVideoList = (arrVBA) => {
  let embebURL = "https://www.youtube.com/embed/";
  return (
    <React.Fragment>
      {Object.keys(arrVBA).map((key, index) => {
        console.log(arrVBA[key]);
        return (
          <div key={index} className="col-4">
            <iframe
              height="300"
              width="400"
              src={embebURL + arrVBA[key]}
              frameBorder="0"
              allow="accelerometer; encrypted-media; gyroscope; picture-in-picture"
              allowFullScreen
            ></iframe>
          </div>
        );
      })}
    </React.Fragment>
  );
};

const Media = (s) => (
  <div>
    <h1>Youtube Code goes here</h1>
    <div className="row">{getVideoList(arrVBA)}</div>
  </div>
);

export default Media;
